import React from 'react'

export default function MealsList(props) {


  const mealItems = props.mealsData.map(item => `<Mealitem
                                     id=${item.id}
                                     title=${item.title}
                                     desc=${item.desc}
                                     price=${item.price}
                                     img=${item.img}/>`)


  return (

    <div>
      {mealItems}

    </div>
  )
}
